import React, { Component } from "react";
import {Link} from "react-router-dom";
import "./accueil.css";

export default class Accueil extends Component{
    constructor(props){
        super(props);
        this.title = "Titre de la location"

        console.log(props.Data);
    }

    render() {
        return (
        <div id="articles">
            <Link to="/a-propos">
                <div id="article">
                    <p id="article__title">{this.title}</p>
                </div>
            </Link>
        </div>
        )
    }
}
